import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { fetchMedicalHistory } from '../actions/userAction'

const Medicalhistory = ({ match }) => {
  const dispatch = useDispatch()
  const medicalHistory = useSelector(state => state.medicalHistory)
  const { loading, error, medicalHistories } = medicalHistory

  useEffect(() => {
    dispatch(fetchMedicalHistory(match.params.userId))
  }, [dispatch, match.params.userId])

  return (
    <div>
      {loading ? <p>Loading...</p> : error ? <p>Error: {error}</p> : (
        <ul>
          {medicalHistories.map(history => (
            <li key={history._id}>{history.diagnosticResult}</li>
          ))}
        </ul>
      )}
    </div>
  )
}

export default Medicalhistory
